import React from 'react'

import {
    BrowserRouter as Router,
    Route,
    Switch,
    Redirect
} from "react-router-dom";
import { MainScreen } from '../components/MainScreen';

export const AppRouter = () => {

    return (
        <Router>
            <div>

                <Switch>
                    <Route path="/main">
                        <MainScreen />
                    </Route>

                    <Redirect to="/main" />
                </Switch>
            </div>
        </Router>
    )
}
